  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0117712 includes Surface
  underway, chemical, meteorological and physical data collected from THALASSA in
  the North Atlantic Ocean from 2012-08-19 to 2012-09-10 and retrieved during cruise
  35LU20120819. These data include BAROMETRIC PRESSURE, Partial pressure (or fugacity)
  of carbon dioxide - atmosphere, Partial pressure (or fugacity) of carbon dioxide
  - water, SALINITY and SEA SURFACE TEMPERATURE. The instruments used to collect these
  data include Barometric pressure sensor, Carbon dioxide (CO2) gas analyzer, Shower
  head chamber equilibrator for autonomous carbon dioxide (CO2) measurement and thermosalinographs.
  These data were collected by Brain Ward of National University of Ireland - Galway
  as part of the VOS_STRASSE_2012 data set.nnThe Global Volunteer Observing Ship (VOS)
  Program is coordinated by the UNESCO International Ocean Carbon Coordination Project
  (IOCCP). International groups from 14 countries have been outfitting research ships
  and commercial vessels with automated CO2 sampling equipment to analyze the carbon
  exchange between the ocean and atmosphere.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
